job_description:
Split level 45 sqm flat.  Works considering include:

1)      Knocking down the roof in living room;

2)      Including one or two Sky lights (and requesting authorization to do so);

3)      Re-plastering and re-painting roof;

4)      Re-flooring the whole flat , including bathroom, with wooden floor;

5)      Knocking down existing built-in wardrobe in bedroom and re-building a custom made one using the space behind it which is the roof above the kitchen.

6)     Re-tiling bathroom and building storage space.
